import React from 'react';

const MenuDesplegable = ({ arrayMarcas }) => (
  <nav id="menu">
    <ul>
      {
        arrayMarcas.length > 0
          ? arrayMarcas.map((item, index) => (
            // eslint-disable-next-line react/no-array-index-key
            <li key={index}>
              {item}
            </li>
          ))
          : null
      }
    </ul>
  </nav>
);

export default MenuDesplegable;
